import React from 'react';


function Calc(a,b){
    return a+b ;
}

function Sub(a,b){
    return a-b ;
}

function Div(a,b){
    return a/b ;
}

function mul(a,b){
    return a*b ;
}

export default Calc;

export {Sub,Div,mul}
